            if (itemsToAdd.includes(item.value)) {
                uTagsRef.current?.dispatchEvent(new CustomEvent('add', {
                    detail: { item },
                }));
                setSelectedItems((prevItems) => ({
                    ...prevItems,
                    [item.value]: item,
                }));
            }
            if (itemsToRemove.includes(item.value)) {
                uTagsRef.current?.dispatchEvent(new CustomEvent('remove', {
                    detail: { item },
                }));
