                    const optionExists = Array.from(inputRef.current?.list?.options || [], getDatalistValue).includes(item.value);
                    if (!optionExists)
                        return;
                }
                setSelectedItems((prevItems) => ({
                    ...prevItems,
                    [item.value]: item,
                }));
            }
            if (e.detail.action === 'remove') {
                setSelectedItems((prevItems) => {
                    const { [item.value]: _, ...rest } = prevItems;
                    return rest;
                });
